import { usersType } from "../types/Types";

export const filterUsersData = (users: usersType[]): any => 
users.map((user: usersType): usersType => {
    return {
        id: user.id,
        name: user.name,
        phone: user.phone,
        username: user.username,
        email: user.email
    }
})
